Double Face (1969 - Italy, West Germany)          A doppia faccia

Thriller
 &lt;a href=&quot;
http://www.imdb.com/title/tt0063979/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt0063979/&lt;/a&gt;


This psychological drama finds Helen wanting a divorce from her adoring husband John. She leaves him and is killed in an auto wreck. John finds himself the target of a police investigation to determine if the death was an accident, murder or suicide. His wife had owned a 90% interest in a British auto company and John is the main suspect should foul play be evident.


Video: XviD, 576x304, 29.970 fps, 1027 Kbps, 01h27m18s
Audio: Dolby AC3, 48000 Hz, stereo, 192 kbps

DUAL AUDIO TRACKS: English, Italian

